Tank Wars – are good old arcade tanks! In battle, gentlemen! Choose one of the 4 ways to fame, each of which is difficult in its own way, from a calm company to a fretting mincing machine. Fight at 120 polygons alone or with your best friend to win, or create your own 990 battlefields. Attack and destroy enemy armored vehicles to achieve the main goal – victory, but do not forget to defend your base in the heat of battles, its destruction leads to the failure of your entire mission. On the way, there will also meet dangerous mini-bosses, victory over which will not be the easiest walk. For the excellent result shown during the battle, you will be awarded medals and your exploits will not be forgotten and will be recorded. Your opponents are well armed, so try to use both terrain, as camouflage and protection, and bonuses on the battlefield that will help improve weapons, turn enemies into wreckage or water into ice for ferrying. Good luck!
